DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `pns_obtener_juego`(IN `partidoid` INT, IN `variableid` INT, IN `puntos` INT)
BEGIN

	DECLARE intervaloid,juegoid INT;

	select

	di.intervalo_id into intervaloid 

	from depor_intervalo as di

	inner join depor_variable as dv on di.variable_id=dv.variable_id

	where dv.variable_id=variableid

	and di.valori<=puntos

	and di.valorf>=puntos

	and di.valori!=di.valorf;

	select juego_id into juegoid from depor_juego 

		where partido_id=partidoid 

		and variable_id=variableid 

		and intervalo_id=intervaloid;

	select juegoid;

END//
