BEGIN

	PREPARE statement FROM

	"SELECT pf.fecha_id, 

	jg.jugador_id, 

	pf.puntaje_juego, 

	pf.puntaje_total, 

	pf.registro, 	 

	jg.grupo_id,

	dj.nombres,

