INSERT INTO `depor_articulo` (`articulo_id`, `tipoarticulo_id`, `usuario_id`, `torneo_id`, `fase_id`, `fecha_id`, `titulo`, `descripcion`, `contenido`, `registro`, `modificacion`, `estado`) VALUES
	(1, 1, 1, 1, 1, 11, 'El \'Zorrito\'Aguirre es goleador en México', 'El &quot;Zorrito&quot; se codea en lo alto de la tabla con el &quot;Hobbit&quot; Christian Bermúdez, del Atlante, el argentino Emanuel Villa del Cruz Azul y Rafael Márquez del Morelia. Cada uno tiene siete tantos. Así es como relatan en México la última a ctuación el primer gol del partido que su eq', 'El peruano Aguirre vive un gran momento en México. El delantero del San Luis, junto con jugadores del Atlante, Monarcas y Cruz Azul comparten la cima de la tabla de goleadores del fútbol mexicano. El &quot;Zorrito&quot; se codea en lo alto de la tabla con el &quot;Hobbit&quot; Christian Bermúdez, del Atlante, el argentino Emanuel Villa del Cruz Azul y Rafael Márquez del Morelia. Cada uno tiene siete tantos. Así es como relatan en México la última actuación el primer gol del partido que su equipo empató 1-1 contra &quot;Atlas&quot;, dice el diario Vanguardia...', '2011-01-11 14:33:10', NULL, '1'),
	(2, 2, 1, 1, 1, 11, 'Alianza Lima promete que no perderá Matute', 'Debido a las deudas que mantiene con la Sunat, el club Alianza Lima corre el riesgo de sufrir el remate de sus propiedades, incluido el estadio Alejandro Villanueva. Sin embargo, el vicepresidente de la institución, Jorge Villareal, dio un mensaje de tranquilidad para la hinchada.', NULL, '2011-01-25 14:36:52', NULL, '1'),
	(3, 3, 1, 1, 1, 11, 'Ultimos pronosticos no te lo pierdas.', 'Mira aquí los resultados Depor', NULL, '2011-02-08 18:52:42', NULL, '1'),
	(4, 1, 1, 1, 1, 11, 'Cobresol de Cardama y su invicto en el torneo', 'Se han jugado seis jornadas del Descentralizado 2011 y son tres los equipos que están invictos: Alianza, Juan Aurich y Cobresol, pero el equipo de Teddy Cardama es el que más sorprende porque recién este año debutó en Primera y se está convirtiendo en uno de los protagonistas del campeonato, superan', NULL, '2011-02-13 16:03:29', NULL, '1'),
	(5, 2, 1, 1, 1, 11, 'Robaron a jugadores de San Martín', 'Los jugadores de Universidad San Martín no solo tuvieron que sufrir la derrota de ayer ante el San Luis de Wilmer Aguirre, sino que fueron sorprendidos por ladrones, que se infiltraron en sus habitaciones del hotel Panorama y los desvalijaron. Orlando Contreras relató que tras volver al hotel que lo', NULL, '2011-03-15 16:04:37', NULL, '1'),
	(6, 1, 1, 1, 1, 11, 'San Martín sumó tres derrotas seguidas en Copa ¿Podrá clasificar en Lima?', 'Michael Arroyo anotó dos goles, dio el pase para otro más y el San Luis de México se llevó el martes un triunfo de 3-1 sobre la Universidad San Martín para mantener con vida sus esperanzas de clasificar a la segunda ronda de la Copa Libertadores.', NULL, '2011-02-18 17:42:53', NULL, '1'),
	(7, 3, 1, 1, 1, 11, 'Nuevos pronostico de la proxima fecha', 'En este articulo encontrarás los últimos pronosticos para la proxima fecha del torneo', NULL, '2011-02-23 18:19:38', NULL, '1'),
	(8, 1, 1, 1, 1, 11, 'El sorprendente Cobresol de Cardama', 'Se han jugado seis jornadas del Descentralizado 2011 y son tres los equipos que están invictos: Alianza, Juan Aurich y Cobresol, pero el equipo de Teddy Cardama es el que más sorprende porque recién este año debutó en Primera y se está convirtiendo en uno de los protagonistas del campeonato, superan', NULL, '2011-03-06 15:32:24', NULL, '1'),
	(9, 2, 1, 1, 1, 12, 'Alianza Lima promete que no perderá Matute', 'Debido a las deudas que mantiene con la Sunat, el club Alianza Lima corre el riesgo de sufrir el remate de sus propiedades, incluido el estadio Alejandro Villanueva. Sin embargo, el vicepresidente de la institución, Jorge Villareal, dio un mensaje de tranquilidad para la hinchada.', NULL, '2011-03-10 15:32:24', NULL, '1'),
	(10, 3, 1, 1, 1, 12, 'Nuevos pronostico de la proxima fecha', 'En este articulo encontrarás los últimos pronosticos para la proxima fecha del torneo', NULL, '2011-03-14 15:32:24', NULL, '1'),
	(11, 1, 1, 1, 1, 12, 'El \'Zorrito\'Aguirre es goleador en México', 'A llenar Matute: Depor te pone las entradas para el partido de Alianza Hola amigos estamos proponiedo reunirnod mañana en la casa de Pedro para jugar con LOS FINOS y asi preparanos para el campeonato. Hola amigos estamos proponiedo reunirnod mañana e', NULL, '2011-03-18 15:32:24', NULL, '1'),
	(12, 2, 1, 1, 1, 12, 'Robaron a jugadores de San Martín', 'Los jugadores de Universidad San Martín no solo tuvieron que sufrir la derrota de ayer ante el San Luis de Wilmer Aguirre, sino que fueron sorprendidos por ladrones, que se infiltraron en sus habitaciones del hotel Panorama y los desvalijaron. Orlando Contreras relató que tras volver al hotel que lo', NULL, '2011-03-20 15:32:24', NULL, '1'),
	(13, 3, 1, 1, 1, 12, 'Ultimos pronosticos no te lo pierdas.', 'Mira aquí los resultados Depor', NULL, '2011-03-25 15:32:24', NULL, '1'),
	(14, 1, 1, 1, 1, 12, 'Nueva Notica Derpo 2012', 'Descripcion noticia depor 2012', NULL, '2011-04-15 12:17:12', NULL, '0'),
	(15, 1, 1, 1, 1, 12, 'Noticia Depor 2012 nuevo mes', 'Descripcion noticia depor 2010 nuevo mes', NULL, '2011-04-20 15:27:28', NULL, '0');
